import React from 'react'
import PropTypes from 'prop-types'
import { Marker, Popup } from 'react-leaflet'

const MapMarker = (props) => {
  return (
    <Marker position={props.position}>
      <Popup>{props.text}</Popup>
    </Marker>
  )
}

export default MapMarker
